Very HQ very rare promo music video. &quot;Woman From Tokyo&quot; is a song from Who Do We Think We Are, the seventh studio album by the English rock band Deep Purple. It was recorded in Rome (in July 1972) and Frankfurt (October 1972) using the Rolling Stones Mobile Studio. It was Deep Purple's last album with the Mark II lineup of the group until Perfect Strangers (1984).

Although &quot;Woman from Tokyo&quot; was a hit single, the group - riven with internal strife - struggled to come up with tracks of the quality of their previous three albums (and first live album). Although it hit number 4 in the UK charts and number 15 in the US charts, it did not sell as well as previous albums. Nonetheless, Deep Purple was the best selling artist in the USA in 1973. The album was certified Gold on April 11, 1973 by the RIAA, selling 500,000 copies in the US.

On the back cover of the album, &quot;Woman From Tokyo&quot; is misspelled &quot;WOMAN FROM TOKAYO&quot; which reflects the way in which the word was pronounced in the vocals by Ian Gillan.

Deep Purple are an English rock band formed in Hertford in 1968. Along with Led Zeppelin and Black Sabbath, they are considered to be among the pioneers of heavy metal and modern hard rock, although some band members believe that their music cannot be categorised as belonging to any one genre. The band incorporated classical music, blues-rock, pop and progressive rock elements. They were once listed by the Guinness Book of World Records as &quot;the loudest pop group&quot;, and have sold over 100 million albums worldwide. Deep Purple were ranked #22 on VH1's Greatest Artists of Hard Rock program.
